import React from "react";
import Card from "./Card";
import Sdata from "./Sdata";

const Services=()=> {
  return (
    <>



<div className="container-fluid nav bg">
            <div className="row">
                <div className="col-10 mx-auto">

              
       
     {  Sdata.map((val,index)=>{
         
         return (
                  <Card 
                  key={index}

                  imgsrc={val.imgsrc}

                  title={val.title}
                    
                    />
         )
  
            })
  
     }



</div>

</div>
</div>


    </>
  );
}

export default Services;
